import { ReactNode } from 'react';
import {
  Box,
  Flex,
  Avatar,
  HStack,
  Link,
  IconButton,
  Button,
  Menu,
  Text,
  MenuButton,
  MenuList,
  MenuItem,
  MenuDivider,
  useDisclosure,
  useColorModeValue,
  FormControl,
  FormHelperText,
  Input,
  Stack,
} from '@chakra-ui/react';
import { HamburgerIcon, CloseIcon, AddIcon } from '@chakra-ui/icons';

const Links = ['Home', 'Login', 'Sign Up'];

const NavLink = (props) => (
  <Link
    px={2}
    py={1}
    rounded={'md'}
    _hover={{
      textDecoration: 'none',
      bg: useColorModeValue('gray.200', 'gray.700'),
    }}
    href={props.path}>
    <Text
    color="blue.200"
    fontSize="sm"
    fontFamily="sans-serif" 
    fontWeight="bolder"
    >
    {props.element}
    </Text>
  </Link>
);

function NavigationBar() {
  const { isOpen, onOpen, onClose } = useDisclosure();

  return (
    <>
      <Box bg={useColorModeValue('gray.100', 'green.200')} px={4}>
        <Flex h={16} alignItems={'center'} justifyContent={'space-between'}>
          <IconButton
            size={'md'}
            icon={isOpen ? <CloseIcon /> : <HamburgerIcon />}
            aria-label={'Open Menu'}
            display={{ md: 'none' }}
            onClick={isOpen ? onClose : onOpen}
          />
          <HStack spacing={8} alignItems={'center'}>
            <Box> <Avatar h={45} w={75} src="images/logo.jpeg"/></Box>
            <HStack
              as={'nav'}
              spacing={4}
              display={{ base: 'none', md: 'flex' }}>
              <NavLink element='Home' path='/'>Home</NavLink>
              <NavLink element='features' path='/features'>Features</NavLink>
              <NavLink element='pricing' path='/pricing'>Pricing</NavLink>
            </HStack>
            <Flex
                
                >
                    <FormControl>
                        <Flex
                        ml={20}
                        flexDir="row"
                        >
                            <FormHelperText color="blue.200" fontSize="sm" mr={5}>Search</FormHelperText>
                            <Input
                            borderColor="blue.200"
                            bg="white"
                            />
                        </Flex>
                    </FormControl>
            </Flex>
            <NavLink element='Login' path='/login'>Login</NavLink>
            <NavLink element='Sign Up' path='/signup'>Sign up</NavLink>
          </HStack>
        </Flex>
      </Box>
    </>
  );
}

export default NavigationBar;
